import Header from "./components/Navbar/Navbar";
import Footer from "./components/Footer/Footer";
import {Container, Row, Col} from "react-bootstrap"
function App() {
  return (
    <div className="App">
      <Header />
      <main className="main-content">
        <Container>
          <Row className='my-5'>
            <Col>
              <h1>Este es el contenido principal</h1>
            </Col>
          </Row>
        </Container>
      </main>
      <Footer />
    </div>
  );
}

export default App;
